import React from "react";
import { Drawer, List, ListItem, ListItemIcon, ListItemText } from "@mui/material";
import { Home, Calculate, School, Code, EventNote } from "@mui/icons-material";
import { Link } from "react-router-dom";

const Sidebar = () => {
  return (
    <Drawer variant="permanent" sx={{ width: 240, flexShrink: 0 }}>
      <List>
        <ListItem component={Link} to="/">
          <ListItemIcon><Home /></ListItemIcon>
          <ListItemText primary="Home" />
        </ListItem>
        <ListItem component={Link} to="/general-aptitude">
          <ListItemIcon><Calculate /></ListItemIcon>
          <ListItemText primary="General Aptitude" />
        </ListItem>
        <ListItem component={Link} to="/interview">
          <ListItemIcon><EventNote /></ListItemIcon>
          <ListItemText primary="Interview" />
        </ListItem>
        <ListItem component={Link} to="/engineering">
          <ListItemIcon><School /></ListItemIcon>
          <ListItemText primary="Engineering" />
        </ListItem>
        <ListItem component={Link} to="/programming">
          <ListItemIcon><Code /></ListItemIcon>
          <ListItemText primary="Programming" />
        </ListItem>
      </List>
    </Drawer>
  );
};

export default Sidebar;
